import Nav from "../Nav";
import Footer from "../Footer";
import React from "react";

export default function Judges() {
  return (
    <React.Fragment>
      <Nav />
      <div className="flex flex-row justify-center py-20 border-b border-gray-200">
        <div className="flex justify-center flex-col max-w-4xl font-Inter">
          <h4 className="text-emerald-600 font-bold text-center">JUDGES</h4>
          <div className="flex justify-center flex-col lg:flex-row">
            <img src="https://cdn-cpgkm.nitrocdn.com/BJerMNmsgWYcXCHaKDvmXrKfJMmsYEAF/assets/static/optimized/rev-10c1954/wp-content/uploads/2022/02/DSC_8385-Enlarge-scaled.jpg"
            class = "shadow-lg rounded-lg max-w-0.5em max-h-0.5em"
            alt = "Mr Kelvin Hong"></img>
          </div>
        </div>
      </div>
      <Footer />
    </React.Fragment>
  );
}
